import React, {Component} from 'react'

export class Basic extends Component{
    render(){
        return(
        <div id="basic" style="border-style: solid; border-width:5px">
            <head>
                <span>Welcome Doctor!</span>
            </head>
            <hr></hr>
            <div id="top">
                Welcome<br></br>
                Doc ID:
            </div>
        </div>
        )
    }
}
